    <script>
    
        
        var lc_on = IsLcOn();
        
        var the_iframe = document.getElementById('player_iframe');
        
        $("#player_iframe").on("load", function () {
            $("#the_frame").attr("style","background-image: none;");
        });
        
        current_sub_name = "sub_"+$("body").data("i");
        if ($("body").data("s") && $("body").data("e")){
            current_sub_name += "_"+$("body").data("s")+"x"+$("body").data("e");
        }
        
        
        var lc_pro_cc = true;
        
        
        var current_sub_data = 0;
        
        if(lc_on){
            var current_sub_data_tmp = JSON.parse(localStorage.getItem(current_sub_name));
        }
        
        
        var sub_hash = 'eb2c94fa3ccc836c39f8ee2b657f13fa';
        /*
        if(current_sub_data_tmp != null){
            if (typeof current_sub_data_tmp === 'object'){
                //console.log(current_sub_data_tmp);
                if(current_sub_data_tmp.sub_hash == sub_hash)
                    current_sub_data = current_sub_data_tmp;
            }
        }
        */    
        
        window.addEventListener('message', message => {
            
            if (message.source == window) {
                return; // Skip message in this event listener
            }
            
            
            var data = false;
            
            try {
                data = JSON.parse(message.data);
            } catch {
                data = false;
            }
            
            
            
            if(data){
                //console.log(data);
            
                if(data.name == 'video_ad'){
                    var imp_value = $.cookie(data.video_ad_imp_key);
                    
                    
                    
                
                    if (imp_value == null){
                        imp_value = "";
                    }
                    
                    if(imp_value.length == 0){
                        imp_count = 1;
                    }else{
                        imp_count = parseInt(imp_value)+1;
                    }
                    
                    $.cookie("video_ad_imp_key", data.video_ad_imp_key , 
                        { 
                            expires : 0.05, 
                            path: "/;SameSite=None", 
                            secure: true
                        }
                    );
                    
                    
                    $.cookie(data.video_ad_imp_key, imp_count , 
                        { 
                            expires : 0.05, 
                            path: "/;SameSite=None", 
                            secure: true
                        }
                    );
                    
                    
                }
                
                
                /*
                if(data.name == 'pro_player_data'){
                    if(Object.keys(subs).length > 0)
                        $("#cc").removeClass("button_inactive");
                    
                    if(current_sub_data != 0){
                        if(data.sub_data.sub_hash == current_sub_data.sub_hash && data.sub_data.url != current_sub_data.url){
                            //console.log(data.sub_data);
                            //console.log(current_sub_data);
                            var pm_json = JSON.stringify(current_sub_data);
                            message.source.postMessage(pm_json,'*');
                        }
                    }
                }
                */
            }
        });
        
        function IsLcOn(){
            var is_on = false;
            try {
                localStorage.setItem('test_lc' , "1");
                if(localStorage.getItem('test_lc') == "1"){
                    is_on = true
                }
            }
            catch(err) {
                return false;
            }
            
            return is_on;
        }
        
        $("#iFrameId").on("load", function () {
            
        });
        
        $("#ad720 #close").click(function(){
            $(this).parent().parent().hide();
            $.cookie("ad720", "1" , 
                { 
                    expires : 0.001, 
                    path: "/;SameSite=None", 
                    secure: true
                }
            );
            
        });
        
        $(document).ready(function(){
            
            $(".servers").show();
                
            if(window.frameElement === null){
                $("#top_buttons_parent").show();
            }else{
                var ref = window.frameElement.getAttribute('data-ref');
                if(ref != null){
                    $(".servers").css("left","100px")
                    
                    if(ref.length > 3){
                        $.get("/is_vip_str.php?ref="+encodeURIComponent(ref), function(data, status){
                            if(data == "1"){
                                $("#top_buttons_parent").hide();
                            }else{
                                $("#top_buttons_parent").show();
                            }
                        });
                    }else{
                        $("#top_buttons_parent").show();
                    }
                }else{
                    $("#top_buttons_parent").show();
                }
            }
        });
